function MatchStats(props) {
    const matchData = props.matchData
    return (
        <div className="p-4 rounded-lg w-full bg-gray-100">
            <div className="w-full h-14 rounded-full flex gap-2">
                <div className="bg-red-400 rounded-full" style={{ width: `${matchData?.content?.stats?.Periods?.All?.stats?.[0]?.stats?.[0]?.stats?.[0]}%` }}></div>
                <div className="bg-green-400 rounded-full" style={{ width: `${matchData?.content?.stats?.Periods?.All?.stats?.[0]?.stats?.[0]?.stats?.[1]}%` }}></div>
            </div>
        </div>
    )
}

export default MatchStats
